/** MCUboot semantic versioning struct */
struct tdf_struct_mcuboot_img_sem_ver {
	uint8_t major;
	uint8_t minor;
	uint16_t revision;
	uint32_t build_num;
} __packed;

/** Generic 3-axis sensor reading */
struct tdf_struct_xyz_16bit {
	int16_t x;
	int16_t y;
	int16_t z;
} __packed;

/** Geographic Coordinate System location */
struct tdf_struct_gcs_location {
	/** Latitude degrees (scale 1e7) */
	int32_t latitude;
	/** Longitude degrees (scale 1e7) */
	int32_t longitude;
	/** Height above reference ellipsoid (mm) */
	int32_t height;
} __packed;

/** LTE cell ID (Local) */
struct tdf_struct_lte_cell_id_local {
	/** E-UTRAN Cell ID */
	uint32_t eci;
	/** Tracking Area Code */
	uint16_t tac;
} __packed;

/** LTE cell ID (Global) */
struct tdf_struct_lte_cell_id_global {
	/** Mobile Country Code */
	uint16_t mcc;
	/** Mobile Network Code */
	uint16_t mnc;
	/** E-UTRAN Cell ID */
	uint32_t eci;
	/** Tracking Area Code */
	uint16_t tac;
} __packed;

/** LTE cell ID (Global) */
struct tdf_struct_lte_cell_neighbour {
	/** Evolved Absolute Radio Frequency Channel (E-ARFCN) */
	uint32_t earfcn;
	/** Physical Cell Identity */
	uint16_t pci;
	/** Time after the serving cell was observed that the neighbor cell was observed */
	uint16_t time_diff;
	/** Reference signal received power (255 = Unknown) */
	uint8_t rsrp;
	/** Reference signal received quality (-128 = Unknown) */
	int8_t rsrq;
} __packed;

/** Bluetooth address type (bt_addr_le_t) */
struct tdf_struct_bt_addr_le {
	/** Address type (0 == Public, 1 == Random) */
	uint8_t type;
	/** Address bytes */
	uint8_t val[6];
} __packed;

/** IEEE EUI-48 address */
struct tdf_struct_eui48 {
	/** Address bytes */
	uint8_t val[6];
} __packed;

/** WiFi network parameters */
struct tdf_struct_wifi_network_params {
	/** Basic Service Set Identifier (MAC address) */
	uint8_t bssid[6];
	/** Frequency band */
	uint8_t band;
	/** Channel index */
	uint8_t channel;
	/** https://w1.fi/wpa_supplicant/devel/defs_8h.html#a4aeb27c1e4abd046df3064ea9756f0bc */
	uint8_t iface_mode;
	/** WiFi link operating mode (https://en.wikipedia.org/wiki/Wi-Fi#Versions_and_generations)
	 */
	uint8_t link_mode;
	/** IEEE 802.11 security type */
	uint8_t security;
	/** Received signal strength (dBm) */
	int8_t rssi;
	/** Beacon interval (ms) */
	uint16_t beacon_interval;
	/** Target Wake Time capable? */
	uint8_t twt_capable;
} __packed;

